function TNLConvWorld:FillStartingPlots()
	print("Placing Starting Plots.");
	
	local customCivTable = nil;
	local pChinesePlayer = nil;
	local bIsHasCustomCS = false;
	for i = 0, GameDefines.MAX_CIV_PLAYERS - 1 do
		local pPlayer = Players[i];
		local pResultPlot = nil;
		if pPlayer == nil or not pPlayer:IsEverAlive() or pPlayer:IsBarbarian() then
		else
			if not pPlayer:IsMinorCiv() then
				print("#MajorCiv: "..i + 1);
				pResultPlot = self:GetMajorCivStartPlot(pPlayer);
			else
				print("%MinorCiv: "..i - GameDefines.MAX_MAJOR_CIVS + 1);
				pResultPlot = self:GetMinorCivStartPlot(pPlayer);
			end
			if     pResultPlot == nil then
				if customCivTable == nil then
					customCivTable = {};
				end
				if pPlayer:IsMinorCiv() then
					bIsHasCustomCS = true;
				end
				table.insert(customCivTable, pPlayer);
			elseif pResultPlot == Map.GetPlot( 80,59) then
				pChinesePlayer = pPlayer;
			else
				pPlayer:SetStartingPlot(pResultPlot);
			end
		end
	end
	
	-- Special True Start Position Setting for CIVILIZATION_CHINA
	if pChinesePlayer then
		local iStartPlotIndex = 0;
		if not Map.GetPlot( 76,60):IsStartingPlot() then
			iStartPlotIndex = 1 + Map.Rand(5, "Place Random True Start Position - LUA");
		end
		if     iStartPlotIndex <= 2 then
			print("Reset Chinese True Start Position to: 82x65");	-- Beijing
			pChinesePlayer:SetStartingPlot(Map.GetPlot( 82,65));
		elseif iStartPlotIndex == 3 then
			print("Reset Chinese True Start Position to: 76x60");	-- Chang'an
			pChinesePlayer:SetStartingPlot(Map.GetPlot( 76,60));
		else								-- Loyang
			pChinesePlayer:SetStartingPlot(Map.GetPlot( 80,59));
		end
	end
	
	-- Custom Civilizations
	if customCivTable then
		self:SetCustomCivStartPlot(customCivTable, bIsHasCustomCS);
	else
		print("All Civ(s) have been placed!");
	end
end
