	elseif (thisCiv.Type == "MINOR_CIV_MELBOURNE")    then ResultPos = { 99, 9};
	elseif (thisCiv.Type == "MINOR_CIV_BOGOTA")       then ResultPos = {153,37};
	--elseif (thisCiv.Type == "MINOR_CIV_VILNIUS")      then ResultPos = { 38,17};
	elseif (thisCiv.Type == "MINOR_CIV_WELLINGTON")   then ResultPos = {112, 8};
	--New CityState
	elseif (thisCiv.Type == "MINOR_CIV_KANCHIPURAM")  then ResultPos = { 62,38};
	elseif (thisCiv.Type == "MINOR_CIV_HAVANA")       then ResultPos = {149,51};
	end
	
	-- New StartPlots from TNL_World_MinorCiv_StartingPlots
	if GameInfo.TNL_World_MinorCiv_StartingPlots{ MinorCivType = thisCiv.Type }() ~= nil then
		local newStartPlot = GameInfo.TNL_World_MinorCiv_StartingPlots{ MinorCivType = thisCiv.Type }();
		ResultPos = {newStartPlot.X,newStartPlot.Y};
	end
	
	if ResultPos[1] == -1 or ResultPos[2] == -1 or Map.GetPlot(ResultPos[1], ResultPos[2]):IsStartingPlot() then
		print("Custom MinorCiv - Set Start Position later...");
	else
	    local resultPlot = Map.GetPlot(ResultPos[1], ResultPos[2]);
	    if (resultPlot:GetTerrainType() < 5) then
		print("MinorCiv True Start Position: "..ResultPos[1].."x"..ResultPos[2]);
		return resultPlot;
	    else
		print("MinorCiv (Error) True Start Position: "..ResultPos[1].."x"..ResultPos[2]);
	    end
	end
	
end
