function TNLConvWorld:SetupScenario()

	--[[
	print("Setup Start Year & Victory.");
	--Game.SetStartYear(-4000);
	Game.SetVictoryValid(0,false);
	Game.SetVictoryValid(1,true);
	Game.SetVictoryValid(2,true);
	Game.SetVictoryValid(3,false);
	Game.SetVictoryValid(4,true);
	]]
	
	print("Placing Start Cities, Buildings & Units.");
	
	include("TNL_NameList");
	
	-- Establish FreeStartEra Buildings List
	local AddFSEBuildingList = {};
	for building in GameInfo.Buildings() do
		-- exclude UB & Over FreeStartEra Buildings
