--[[ Start generate map]]--
function StartPlotSystem()
	
	print("Start generate custom map...");
	
	local TNL_ConvWorld  = TNLConvWorld.Create();
	local plotTypes      = TNL_ConvWorld:GeneratePlotTypes();
	SetPlotTypes(plotTypes);
	local terrainTypes   = TNL_ConvWorld:GenerateTerrain();
	SetTerrainTypes(terrainTypes);
	TNLConvWorld:FillPlots();
	TNLConvWorld:FillTerrains();
	Map.RecalculateAreas();
	TNLConvWorld:FillRivers();
	TNLConvWorld:FillRegions();
	TNLConvWorld:FillFeatures();
	TNLConvWorld:PlaceNaturalWonders();
	
	local Starting_Locations = Map.GetCustomOption(1);
	local res                = Map.GetCustomOption(2);
	if Starting_Locations ~= 1 then			-- True   Starting Locations
		TNL_ConvWorld:FillStartingPlots();
	end
	if Starting_Locations == 1 or res ~= 1 then	-- Random Starting Locations or Resources
		print("Creating start plot database.");
		local start_plot_database = AssignStartingPlots.Create()
		print("Dividing the map in to Regions.");
		-- Get Resources setting input by user.
		if res == 7 then res = 2 + Map.Rand(3, "Random Resources Option - Lua") end;
		-- Regional Division Method 2: Continental
		local args = {method = 2, resources = math.max(1, res - 1)};
		start_plot_database:GenerateRegions(args)
		print("Choosing start locations for civilizations.");
		-- Forcing starts along the ocean.
		args = {mustBeCoast = false};
		start_plot_database:ChooseLocations(args)
		print("Normalizing start locations and assigning them to Players.");
		start_plot_database:BalanceAndAssign()
		print("Placing Resources and City States.");
		start_plot_database:PlaceResourcesAndCityStates()
		-- Reserved for   Suez Canal
		Map.GetPlot( 31,47):SetResourceType(-1); Map.GetPlot( 32,47):SetResourceType(-1); Map.GetPlot( 31,48):SetResourceType(-1);
		Map.GetPlot( 33,48):SetResourceType(-1); Map.GetPlot( 31,49):SetResourceType(-1); Map.GetPlot( 32,49):SetResourceType(-1);
		Map.GetPlot( 32,49):SetResourceType(18, 1);						-- Nearby Marble
		-- Reserved for Panama Canal
		Map.GetPlot(151,40):SetResourceType(-1); Map.GetPlot(152,40):SetResourceType(15, 1);	-- Nearby Gold
	end
	if res == 1 then
		TNLConvWorld:FillResources();
		TNLConvWorld:FillImprovements();
	end
	if Starting_Locations == 3 then	-- Enhance Old Civs - Scenario
		TNL_ConvWorld:SetupScenario();
	end
	
	print("Map complete!");
	
end
